import ComponentA from "./components/screens/componentA";
import ComponentB from "./components/screens/componentB";
import ComponentC from "./components/screens/componentC";

// import ToDo from "./components/screens/todo";

const UserContext = React.createContext()

function App() {
  return (
    <div> 
      <UserContext.Provider value={"Shame"}>
        <ComponentA />
        <ComponentB />
        <ComponentC />
      </UserContext.Provider>
    </div>
  )
}

export default App
